@import url('https://fonts.googleapis.com/css2?family=Poppins&display=swap');

body,
html {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    font-family: 'Poppins', sans-serif;
}

.App {
    position: relative;
    display: flex;
    justify-content: center;
    align-items: center;
    padding: 1em 0;
    width: 100%;
    height: 100vh;
    background: rgb(0, 0, 0);

    .App-header {
        position: relative;
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        justify-content: space-between;
        width: 25em;
        height: 10em;
        background: rgba(0, 0, 0, 0.198);
        border: 0.5px solid rgba(77, 77, 77, 0.671);
        box-shadow: 0px 1px 4px 0.5px black;
        border-radius: 15px;
        padding: 1em 1em;


        h1 {
            position: relative;
            display: flex;
            color: RGB(13, 159, 139);
            font-size: 15px;
            text-align: right;
            line-height: 1em;
            margin-top: 1em;
        }
    }

    .circle-1 {
        position: absolute;
        display: flex;
        width: 600px;
        height: 600px;
        background: linear-gradient(180deg, rgba(63, 63, 63, 0.8) 0%, rgba(7, 179, 156, 0.027) 35%);
        border: 0.05px solid rgba(0, 0, 0, 0.465);
        box-shadow: 0px 0px 12px 0.05px rgba(0, 0, 0, 0.185);
        border-radius: 100%;
    }

    .circle-2 {
        position: absolute;
        display: flex;
        width: 600px;
        height: 600px;
        background: linear-gradient(360deg, rgba(63, 63, 63, 0.8) 0%, rgba(7, 179, 156, 0) 35%);
        border-radius: 100%;
    }

    .circle-3 {
        position: absolute;
        display: flex;
        width: 300px;
        height: 300px;
        background: linear-gradient(240deg, rgba(113, 121, 126, 0.979) 0%, rgba(0, 0, 0, 0.952) 85%);
        border: 0.05px solid rgba(0, 0, 0, 0.465);
        box-shadow: 0px 0px 12px 0.05px rgba(0, 0, 0, 0.185);
        border-radius: 100%;
        margin-top: -15em;
        margin-right: -30em;
    }
}
